import React from 'react';
import SectionTitle from '../section_title/section_title';
import './about.css'

const aboutBlurbs = ['Hello there!',
'I\'m Justin Santos — a graduate student, software engineer, and lover of technology. ' +
'There are more tools at our disposal than any other time in human history; my goal is to utilize today\'s tools to solve tomorrow\'s problems.',
'My academic and professional interests include data and algorithm visualization, artificial intelligence, and machine learning.',
'Outside of the realm of computer science, I enjoy drinking boba, occasionally working out, and playing competitive video games (Valorant is my favorite at the moment). ']


class About extends React.Component {
  render() {
    const imgPath = './../../assets/me.jpg'
    return (
      <div className="about section-wrapper" id="about">
        <SectionTitle sectionName="about" />
        <div className="about-text-wrapper">{
          aboutBlurbs.map(blurb => (
            <div className="about-text">{blurb}</div>)
          )
        }</div>
        <img alt="me" src={ imgPath }></img>
      </div>
    )
  }
}

export default About
